import { useEffect } from 'react';
import { useState } from 'react';

function livedate(){
    const [now,setNow]=useState(1)
    function updateNow() {
        setNow(prevNow=>prewNow+1)
    }
    useEffect(()=>{
        setInterval (()=>{updateNow()},1000)
      },[])

    return (
         <div>this is now:
                {now}
            </div>)
}

export default livedate
